import React, { Component } from "react";
import Axios from "axios";

class Maskcall extends Component {
    async maskapi(a,b) {
        const result = await Axios.get('https://8oi9s0nnth.apigw.ntruss.com/corona19-masks/v1/storesByGeo/json', {
            params : {
                lat : a,
                lng : b,
                m : 1000
            }
        })
        if (result.status ===200) {
            console.log(result);
        }
        else { console.log('API 서버가 지연되고 있습니다.') }
    }
    render() {
        const baram = this.props;
        console.log(baram);
        return (
            <>
            {this.maskapi(baram.mylat, baram.mylng)}
            </>
        )
    }


}


export default Maskcall;
